import React from "react";

function AboutUs() {
  return (
    <>
      <div>
        <h1 className="about">ABOUT US</h1>
        <h3>
          Welcome to our website, we are a family owned business!
        </h3>
      </div>
      <div className="about-us-p">
        <p>
          Adventure Room was established in 2022, with the intent to create a
          new kind of fun for our dear customers! Giving you a unique experience
          around the world with our set up displays for selfie taking. Our goal
          is to strive to create a comfortable and exciting atmosphere for you
          to enjoy while visiting us!
        </p>
      </div>
    </>
  );
}

export default AboutUs;
